import React from "react"

const Navbar = (props) =>{
    //const response = props.response.data;
    //const data =  props.res.result;
    console.log(props)
    let countac=0;
    for(let i=0;i<props.res.length;i++){
      if(props.res[i].verdict==="OK"){
        count+=1;
      }
    }
    console.log(count);
    
    return(
        <div>
            <h1>AC: {count}</h1>
        </div>
    )



}

export default Navbar
